import React from "react";

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <div style={styles.container}>
        <p style={styles.text}>&copy; {new Date().getFullYear()} Polysia. All Rights Reserved.</p>
        <div style={styles.links}>
          <a href="/privacy-policy" style={styles.link}>Privacy Policy</a>
          <a href="/terms-of-service" style={styles.link}>Terms of Service</a>
          <a href="/contact" style={styles.link}>Contact Us</a>
        </div>
      </div>
    </footer>
  );
};

const styles = {
  footer: {
    backgroundColor: "#111",
    color: "#fff",
    textAlign: "center",
    padding: "15px 0",
    position: "fixed",
    width: "100%",
    bottom: "0",
    boxShadow: "0 -2px 5px rgba(0, 0, 0, 0.2)",
  },
  container: {
    maxWidth: "1200px",
    margin: "0 auto",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "0 20px",
  },
  text: {
    margin: "0",
    fontSize: "14px",
  },
  links: {
    display: "flex",
    gap: "15px",
  },
  link: {
    color: "#bbb",
    textDecoration: "none",
    fontSize: "14px",
    transition: "color 0.3s ease-in-out",
  },
  linkHover: {
    color: "#fff",
  },
};

export default Footer;
